import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import { Slider, TextField, MenuItem, Box, Typography } from '@mui/material';
import L from 'leaflet';
import Footer from '../components/Footer';
import data from '../data/updated_test_data_with_ids.json'; // Adjust the path to your data file

// Importing the custom marker icon
import markerIcon from '../assets/marker-icon.png';

const HomePage = ({ isAdmin }) => {
  const navigate = useNavigate();
  const [rent, setRent] = useState([0, 5000]);
  const [rooms, setRooms] = useState('');
  const [bathrooms, setBathrooms] = useState('');
  const [area, setArea] = useState('');
  const [filteredData, setFilteredData] = useState(data);

  useEffect(() => {
    if (isAdmin) {
      navigate('/admin');
    }
  }, [isAdmin, navigate]);

  useEffect(() => {
    const filtered = data.filter((item) => {
      return (
        item.rent >= rent[0] &&
        item.rent <= rent[1] &&
        (rooms ? item.rooms === parseInt(rooms) : true) &&
        (bathrooms ? item.bathrooms === parseFloat(bathrooms) : true) &&
        (area ? item.area === area : true)
      );
    });
    setFilteredData(filtered);
  }, [rent, rooms, bathrooms, area]);

  const handleRentChange = (event, newValue) => {
    setRent(newValue);
  };

  const customIcon = new L.Icon({
    iconUrl: markerIcon,
    iconSize: [35, 45],
    iconAnchor: [17, 46],
    popupAnchor: [0, -46],
  });

  return (
    <Box display="flex" flexDirection="column" minHeight="100vh">
      <Box className="filter-container">
        <Box className="filter-item">
          <Typography variant="h6">Rent</Typography>
          <Slider
            value={rent}
            onChange={handleRentChange}
            valueLabelDisplay="auto"
            min={0}
            max={5000}
          />
        </Box>
        <TextField
          className="filter-item"
          label="Number of Rooms"
          type="number"
          value={rooms}
          onChange={(e) => setRooms(e.target.value)}
        />
        <TextField
          className="filter-item"
          label="Number of Bathrooms"
          type="number"
          step="0.5"
          value={bathrooms}
          onChange={(e) => setBathrooms(e.target.value)}
        />
        <TextField
          className="filter-item"
          label="Area"
          select
          value={area}
          onChange={(e) => setArea(e.target.value)}
        >
          <MenuItem value="">All</MenuItem>
          <MenuItem value="Southend Halifax">Southend Halifax</MenuItem>
          <MenuItem value="Central Halifax">Central Halifax</MenuItem>
          <MenuItem value="Clayton Park">Clayton Park</MenuItem>
          <MenuItem value="Rockingham">Rockingham</MenuItem>
          <MenuItem value="Larry Uteck">Larry Uteck</MenuItem>
        </TextField>
      </Box>
      <Box flexGrow={1}>
        <MapContainer center={[44.6488, -63.5752]} zoom={13} className="leaflet-container">
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          />
          {filteredData.map((property) => (
            <Marker
              key={property.id}
              position={[property.latitude, property.longitude]}
              icon={customIcon}
            >
              <Popup>
                <Typography variant="h6">{`Property ID: ${property.id}`}</Typography>
                <Typography variant="body1">{`Rent: ${property.rent} CAD`}</Typography>
                <Typography variant="body1">{`Rooms: ${property.rooms}`}</Typography>
                <Typography variant="body1">{`Bathrooms: ${property.bathrooms}`}</Typography>
                <Typography variant="body1">{`Area: ${property.area}`}</Typography>
              </Popup>
            </Marker>
          ))}
        </MapContainer>
      </Box>
      <Footer />
    </Box>
  );
};

export default HomePage;
